    companion object {
        private const val DB_NAME = "Vax" //name of database
        private const val DB_VERSION = 1 //version of db
        private fun insertData(
            db: SQLiteDatabase,
            ID: String,
            longtitude: String,
             latitude: String,
            properties_url: String,
            properties_city: String,
            properties_state: String,
            address: String,
            postal_code: String,
            provider_brand_name: String

        ) { //method to insert locations into db
            val dataInfo = ContentValues()
            dataInfo.put("ID", ID)
            dataInfo.put("longtitude", longtitude)
            dataInfo.put("latitude", latitude)
            dataInfo.put("properties_url", properties_url)
            dataInfo.put("properties_city", properties_city)
            dataInfo.put("properties_state", properties_state)
            dataInfo.put("address", address)
            dataInfo.put("postal_code", postal_code)
            dataInfo.put("provider_brand_name", provider_brand_name)

            db.insert("VAX", null, dataInfo)
        }
